Writers:  Paul Levitz
Penciller:  Greg LaRocque
Inkers:  Larry Mahlstedt
Colorists:  Carl Gafford
Letterer:  John Costanza
Cover:  Greg LaRocque, Larry Mahlstedt, and Anthony Tollin

Dream Girl has a prophetic vision where R.J. Brande is attacked. A cadre of the Legion of Super-Heroes goes to visit R.J. Brande, who refuses the Legion's help. Before too long, someone does attack R.J. Brande and the Legion are able to help him. The trace the attack back to Leland McCauley, a rival of R.J. Brande, but R.J. won't press charges, so they have to let the madman go. Meanwhile, Brainiac 5 tries to help Jacques Foccart, the Invisible Kid, to control his newfound power of teleportation.

A special feature in this issue introduces every member of the current incarnation of the Legion of Super-Heroes.

